import React from "react";
// import changeDateFormat from '../util/change-format-date.js';

class Todo extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          done: true
        };
    }

    render () {
        const {index, item} = this.props;

        return(
                <li>
                    <label className= 'textFormat'>
                        {index} {item}
                    </label>

                </li>
        )
    }
}

export default Todo;
